import './App.css';
import React, { useContext } from 'react' // Remove `isExplicitlyLoggedIn` from destructuring
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import QueryForm from './QueryForm.js';
import MapCoords from './MapCoords.js';
import ReportForm from './ReportForm.js';
import AuthPage, { AuthContext } from './AuthPage.js'; // AuthPage is your provider

export default function App() {
  return (
    <Router>
      <AuthPage>
        <AppContent/>
      </AuthPage>
    </Router>
  )
}

const AppContent = () => {
  // Use 'user' and 'token' to determine authentication status.
  // 'user' is often preferred as it means user data has been hydrated.
  const { user, token, handleSignOut, isLoadingAuth } = useContext(AuthContext); // Get isLoadingAuth too

  // Determine if the user is authenticated
  const isAuthenticated = !!user; // This will be true if the 'user' object is not null/undefined

  // --- NEW: Handle loading state while authentication is initializing ---
  if (isLoadingAuth) {
    return (
      <div className="app-loading">
        <p>Initializing application...</p>
      </div>
    );
  }

  // --- NEW: If not authenticated, let AuthPage handle rendering the login form ---
  // AuthPage will render its children (AppContent) ONLY if logged in.
  // If not logged in, AuthPage renders the LoginForm directly.
  if (!isAuthenticated) {
    return null; // Return null here, because AuthPage is handling the login UI
  }

  return (
    <div className="App">
      <h1 className="header"> Landslides </h1>
      <nav className="navbar">
        <ul className="nav-list">
          <li className="nav-item">
            <Link to="/" className="nav-list">Home</Link>
          </li>
          {isAuthenticated && ( // Now this condition will work correctly
            <>
              <li className="nav-item">
                <Link to="/query" className="nav-list">Query</Link>
              </li>
              <li className="nav-item">
                <Link to="/report" className="nav-list">Report</Link>
              </li>
            </>
          )}
          {user ? ( // This also uses 'user' so it will be consistent
            <>
              <li className="nav-item nav-text">
                Logged in as: {user.email} 
              </li>
              <li className="nav-item">
                <button onClick={handleSignOut} className="nav-button">Logout</button>
              </li>
            </>
          ) : (
            // This 'else' case should ideally not be reached if isAuthenticated is true
            <li className="nav-item"></li>
          )}
        </ul>
      </nav>

      <div className="content-area">
        <Routes>
          {/* These routes will only be rendered if isAuthenticated is true, */}
          {/* because the 'if (!isAuthenticated)' block above prevents rendering AppContent otherwise. */}
          <Route path="/" element={<MapCoords/>} />
          <Route path="/query" element={<QueryForm/>} />
          <Route path="/report" element={<ReportForm/>} />
        </Routes>
      </div>
    </div>
  );
};

// NoAccessMessage is no longer strictly needed for routing control here,
// as the primary authentication check is done higher up.
const NoAccessMessage = () => (
  <div className="flex items-center justify-center min-h-screen bg-gray-100 p-4">
    <div className="bg-white p-8 rounded-xl shadow-lg text-center">
      <p className="text-lg text-red-700">Please log in to access this page.</p>
    </div>
  </div>
);
